import React from "react";
import Home from "./Home";

class Content extends React.Component {

    activePanel(panel){
        return(
            <div>
                <Home/>
            </div>
        )
    }

    render(){
        return(
            <div>
                {this.activePanel()}
            </div>
        );
    }
}

export default Content;
